{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"name":"hw7-deepdream.ipynb","provenance":[],"collapsed_sections":[],"authorship_tag":"ABX9TyNQwDc5xt5Esx6HvCJDaKbx"},"kernelspec":{"name":"python3","display_name":"Python 3"}},"cells":[{"cell_type":"code","metadata":{"id":"XwivQb51zOu6","colab_type":"code","outputId":"64463e4b-cd5b-46cb-ffb1-30c8b2e8a80b","executionInfo":{"status":"ok","timestamp":1587056592600,"user_tz":300,"elapsed":20,"user":{"displayName":"Muneeb Shahid","photoUrl":"https://lh3.googleusercontent.com/a-/AOh14GijZvNepKAaUj08tWn4w9VaqZOlZChqMn_vzfHmqA=s64","userId":"03964504886047583174"}},"colab":{"base_uri":"https://localhost:8080/","height":429}},"source":["import os\n","from io import BytesIO\n","import numpy as np\n","import PIL.Image\n","from IPython.display import clear_output, Image, display  # , HTML\n","\n","# version 2.X\n","import tensorflow as tf2\n","import tensorflow.compat.v1 as tf\n","tf.disable_v2_behavior()\n","\n","directory = os.getcwd() + '//'\n","model_fn = directory + 'tensorflow_inception_graph.pb'\n","\n","# creating TensorFlow session and loading the model\n","graph = tf.Graph()\n","sess = tf.InteractiveSession(graph=graph)\n","with tf.gfile.FastGFile(model_fn, 'rb') as f:\n","    graph_def = tf.GraphDef()\n","    graph_def.ParseFromString(f.read())\n","\n","layers = [op.name for op in graph.get_operations() if op.type == 'Conv2D' and 'import/' in op.name]\n","feature_nums = [int(graph.get_tensor_by_name(name + ':0').get_shape()[-1]) for name in layers]\n","\n","# print(layers[-10:])\n","# print('Number of layers', len(layers))\n","# print('Total number of feature channels:', sum(feature_nums))\n","\n","t_input = tf.placeholder(np.float32, name='input')  # define the input tensor\n","# imagenet_mean = 117.0\n","t_preprocessed = tf.expand_dims(t_input - 117.0, 0)\n","tf.import_graph_def(graph_def, {'input': t_preprocessed})\n","\n","# The default image: a random image with a little noise\n","img_noise = np.random.uniform(size=(224, 224, 3)) + 100.0\n","\n","\n","def show_img(a, fmt='jpeg'):\n","    a = np.uint8(np.clip(a, 0, 1) * 255)\n","    f = BytesIO()\n","    PIL.Image.fromarray(a).save(f, fmt)\n","    gen_img = Image(data=f.getvalue())\n","    display(gen_img)\n","\n","\n","def visstd(a, s=0.1):\n","    '''Normalize the image range for visualization'''\n","    return (a - a.mean()) / max(a.std(), 1e-4) * s + 0.5\n","\n","\n","def T(layer):\n","    '''Helper for getting layer output tensor'''\n","    # for op in tf.get_default_graph().get_operations():\n","    #   print(str(op.name))\n","\n","    return graph.get_tensor_by_name(\"import/%s:0\" % layer)\n","\n","\n","def calc_grad_tiled(img, t_grad, tile_size=512):\n","    '''Compute the value of tensor t_grad over the image in a tiled way.\n","    Random shifts are applied to the image to blur tile boundaries over\n","    multiple iterations.'''\n","    sz = tile_size\n","    h, w = img.shape[:2]\n","    sx, sy = np.random.randint(sz, size=2)\n","    img_shift = np.roll(np.roll(img, sx, 1), sy, 0)\n","    grad = np.zeros_like(img)\n","    for y in range(0, max(h - sz // 2, sz), sz):\n","        for x in range(0, max(w - sz // 2, sz), sz):\n","            sub = img_shift[y:y + sz, x:x + sz]\n","            g = sess.run(t_grad, {t_input: sub})\n","            grad[y:y + sz, x:x + sz] = g\n","    return np.roll(np.roll(grad, -sx, 1), -sy, 0)\n","\n","\n","def render_deepdream(t_obj, img0=img_noise,\n","                     iter_n=10, step=1.5, pic_n=5):\n","    t_score = tf.reduce_mean(t_obj)  # defining the optimization objective\n","    t_grad = tf.gradients(t_score, t_input)[0]  # behold the power of automatic differentiation!\n","\n","    img = img0\n","    for pic in range(pic_n):\n","        for i in range(iter_n):\n","            g = calc_grad_tiled(img, t_grad)\n","            img += g * (step / (np.abs(g).mean() + 1e-7))\n","            print('.', end=' ')\n","        clear_output()\n","        show_img(img / 255.0)\n","\n","\n","# img = PIL.Image.open(directory + 'hawkeye.jpg')\n","# img = PIL.Image.open(directory + 'pitt.jpg')\n","img = PIL.Image.open(directory + 'trump.jpg')\n","img = np.float32(img)\n","show_img(img / 255.0)\n","\n","# Picking some internal layer. Note that we use outputs before applying the ReLU nonlinearity\n","# to have non-zero gradients for features with negative initial activations.\n","# layer = 'mixed4d_3x3_bottleneck_pre_relu'\n","layer = 'mixed5a_3x3_bottleneck_pre_relu'\n","# render_deepdream(T(layer)[:,:,:,139], img) # 139 is the channel number\n","render_deepdream(T(layer)[:, :, :, 90], img)  # 99 is the channel number\n","# render_deepdream(tf.square(T('mixed4c')), img)\n","tf.InteractiveSession.close(sess)"],"execution_count":11,"outputs":[{"output_type":"display_data","data":{"image/jpeg":"\n","text/plain":["<IPython.core.display.Image object>"]},"metadata":{"tags":[]}}]}]}